import React from "react";
import "./style.css";
// import space from "../../utils/images/space.gif";
import berries from "../../utils/images/memberBerries.gif"
import styled from "styled-components"


const FlipCard = styled.div`
transform: ${props => props.active ? "rotateY(180deg)" : null}
.flip-card-inner {
  transform: ${props => props.active ? "rotateY(180deg)" : null}
}
`

function FriendCard(props) {
  console.log(props)
  return (
    <div className="card" onClick={props.onClick}>
      <div className="img-container">
        <FlipCard className="flip-card" active={props.active}>
          <div className="flip-card-inner">
            <div className="flip-card-front">
              <img src={berries} alt="cardBack" />
            </div>
            <div className="flip-card-back">
              <img alt="cards" src={props.image} id={props.id}/>

            </div>
          </div>
        </FlipCard>
      </div>
    </div>

  );
}

export default FriendCard;
